import React from 'react';
import './nav.css';

function Nav() {
    return (
        <div>
            <div className='nav02'>
                <img cl src='http://www.freepngclipart.com/download/reading/78273-vector-open-book-hand-painted-free-download-png-hd.png' alt="Logo" height={50}/>
                <h3 className='h302'>HOME</h3>
                <div className='navright02'>
                    <h5 className='h502'>contact</h5>
                    <h5 className='h502'>info</h5>
                    <h5 className='h502'>Log-out</h5>
                </div>
            
            </div>
            <hr></hr>
        </div>
    );
}

export default Nav;
